import React from "react";
import '././App.css';

interface BlockProps{
    value?:string | null;
    onClick?:()=> void;
}


export const Block:React.FC<BlockProps>= (props)=>{
    var style = props.value === 'X'?'x':'o'
    return(
        <div onClick={props.onClick} className="block {style}">{props.value}</div>
    )};
